import React from "react";
import UserSelectBtn from "../Components/UserSelectBtn.jsx";
import "./Home.css";
function Home() {
  return (
    <div>
      <h1 id="logo">
        TRIVIA<span id="name">SMASH</span>
      </h1>
      <UserSelectBtn />
      <h3 id="disc">
        <a href="discord.com">Discord</a>
      </h3>
    </div>
  );
}

export default Home;
